import React, { Component } from "react";
import { NavLink } from "react-router-dom";

export default class Images extends Component {
    render() {
        return (
            <div>
                <h1>ï¼­edCalculator</h1>
                <label>Kg<input type="number" name="weight" /></label>
                <label> Age<input type="number" name="age" /></label>
                <label> Cre<input type="number" name="cre" /></label>
            </div>
        );
    }
}

class Counter extends Component {
    constructor(props) {
      super(props);
      this.state = { count: 100 };
    }

    handleInc = () => this.setState(state => ({ count: state.count + 1 }));
    handleDec = () => this.setState(state => ({ count: state.count - 1 }));

    render() {
      return (
        <div>
          <h1>{this.state.count}</h1>
          <span>
            <button onClick={this.handleInc}>+</button>
            <button onClick={this.handleDec}>-</button>
          </span>
        </div>
      );
    }
  }
